import logo from './logo.svg';
import './App.css';
import { Layout, Menu, Breadcrumb, Row, Col, Select, Button } from 'antd';
import { SearchOutlined, ShoppingFilled, UserOutlined } from '@ant-design/icons';
import { Badge, TabBar } from 'antd-mobile'
import React, { useState } from 'react'
import {
  UserOutline,
  TextOutline
} from 'antd-mobile-icons'

const { Option } = Select;
const { Header, Content, Footer } = Layout;



const tabs = [
  {
    key: 'home',
    title: 'Home',
    icon: <ShoppingFilled />,
  },
  {
    key: 'orders',
    title: 'Orders',
    icon: <TextOutline />,
  },
  {
    key: 'personalCenter',
    title: 'Account',
    icon: <UserOutline />,
  },
]

const userCategories = [
  {
    key: 'All',
    title: 'All',
    value: 'all'
  },
  {
    key: 'Following',
    title: 'Following',
    value: 'following'
  },
  {
    key: 'Category1',
    title: 'Category1',
    value: 'category1'
  },
  {
    key: 'Category2',
    title: 'Category2',
    value: 'category2'
  },
  {
    key: 'Category3',
    title: 'Category3',
    value: 'category3'
  }
]

const users = [
  {
    key: 'user1',
    title: 'First Name',
    value: 'First Name'
  }, 
  {
    key: 'user2',
    title: 'First Name',
    value: 'First Name'
  },
  {
    key: 'user3',
    title: 'First Name',
    value: 'First Name'
  },
  {
    key: 'user4',
    title: 'First Name',
    value: 'First Name'
  },
  {
    key: 'user5',
    title: 'First Name',
    value: 'First Name'
  }
]

function App() {
  const [activeKey, setActiveKey] = useState('todo')

  return (
    <div>
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
      <Layout>
        <Header style={{  width: '100%', color: 'white', borderBottom: '1px solid lightGrey' }}>
          <div className="leftBlock">
              <div className="logo" />
          </div>
          <div className="centerBlock">
            <div className="zipcode">
              <sapn>zipcode:</sapn>
              <Select defaultValue={94066} style={{ width: 100, color: 'green', fontWeight: 'bold' }} bordered={false}>
                <Option value={94066}>94066</Option>
                <Option value={92122}>92122</Option>
                <Option value={92092}>92092</Option>
              </Select>
            </div>
          </div>
          <div className="rightBlock">
            <SearchOutlined style={{ fontSize: '25px', color: 'black', float: 'right', marginRight: '20px'}}/>
          </div>
        </Header>
        <Content className="site-layout">
          <div className="site-layout-background" style={{ minHeight: 500 }}>
            <div className="imagePlace">
              <img 
                src="https://s3-alpha-sig.figma.com/img/b548/7384/1efdee96c77b2e50aa34ca4d684f0aa9?Expires=1637539200&Signature=UCnIxE0F1HISW5a2fOT3uLRFBGfYz9Sro8-SnuXh7nhM2EqLX5RC7v9REKBsEGQ6zeQd1hRjiUnVSO8U1tOkgTla2j-tYb1Sy6oT784erIe~VBf-adi9l8qdgXCwHjNLC2sP1WxfTRFMY11bl1HHwpziN4Yj7wqj7tHNDOEXkuIavkJbszql0ZG44P-9HUMP1LpFXxQ2LzUB~oguhg66xHz~zO9ANgSUQI-~MxdyPd5aOlfmEHruWlx02PDAPZeFz1Oh0ngz9NkMoWgI2RHSo94Hz9QxVVuh4A8RdPnv7k~Od4Wqk23NdCbRVhDDLZRbVeezPI6NISi4N09bLB8HAw__&Key-Pair-Id=APKAINTVSUGEWH5XD5UA"
                style={{ width:'100%', borderRadius: '10px' }}
              />
              <div className="imageTextHeader">
                AirMart
              </div>
              <div className="imageTextBlock">
                Offering only the best, freshest <br />
                harvest from local stores!
              </div>
            </div>
            <div className="userCategory">
              {userCategories.map(item => (
                <Button className="categoryItem" shape="round" size={"large"}>
                  {item.title}
                </Button>
              ))}
            </div>
            <div className="userGroup">
              {users.map(item => {
                <div>
                  <div>{item.name}</div>
                </div>
              })}
            </div>
          </div>
        </Content>
        <Footer style={{ textAlign: 'center', background: 'white' }}>
            <TabBar activeKey={activeKey} onChange={setActiveKey}>
              {tabs.map(item => (
                <TabBar.Item style={{ display: 'inline-block' }} key={item.key} icon={item.icon} title={item.title} />
              ))}
            </TabBar>
        </Footer>
      </Layout>
    </div>
  );
}

export default App;
